   "source": [
    "### **About Bellabeat**\n",
    "Bellabeat is a high-tech company that manufactures health-focused smart products founded in 2013 by Urska Srsen and Sando Mur. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. \n",
    "Bellabeat products became available through a growing number of online retailers in addition to their own e-commerce channel on their website. The company has invested in traditional advertising media, such as radio, out-of-home billboards, print, and television, but focuses on digital marketing extensively.\n",
    "\n",
    "### **Business Task**\n",
    "Focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. \n",
    "\n",
    "### **Guiding Questions**\n",
    "* What are some trends in smart device usage?\n",
    "* How could these trends apply to Bellabeat customers?\n",
    "* How could these trends help influence Bellabeat marketing strategy?\n"
   ]
  },
  {
