   "source": [
    "### **Data Summary** \n",
    "This Kaggle data set contains personal fitness tracker from thirty Fitbit users that consented to the submission of personal tracker data.This dataset generated by respondents to a distributed survey between 03.12.2016-05.12.2016\n",
    "\n",
    "I downloaded the CSV files from the Kaggle database and saved each dataset with its original file name so that I could easily identify what I was looking at in my folder. I named the folder \"Fitabase Data.\"\n",
    "\n",
    "I reviewed the different datasets on Big Query, Google Sheets and R Studio and found that I was most comfortable with R Studio Google Sheets for this project. \n",
    "\n"
   ]
